import React from 'react'
import UsersList from '../components/UsersList';

function User() {
    const USERS = [
        {id:"1", image:"https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.liveabout.com%2Ftop-cartoon-characters-of-all-time-137606&psig=AOvVaw1UPWy0qWr-VNWdxkBwIy7O&ust=1686375505111000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCMCv2rm8tf8CFQAAAAAdAAAAABAE", name:"Iris", placeCount:3}
    ]
    return <UsersList items={USERS}/>
}

export default User;
